INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(3, 'HYPERION KING', 'W komputerze G4M3R Hero Plus znajdziesz komponenty najnowszej generacji. Dobraliśmy je tak, aby w pełni wykorzystać ich potencjał. Nowoczesne i inteligentne rozwiązania zapewnią Ci maksymalną wygodę oraz możliwość personalizacji sprzętu.\n', , 'Intel Core i7', '64 ', '512 GB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 10 Home', 1, 9038, 47);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(4, 'DZISIW 2', 'Zdominuj rozgrywkę z najnowszym laptopem DZISIW 2. Napędzany procesorem Intel® Core™ 14. generacji (Intel Raptor Lake) i laptopową kartą graficzną NVIDIA® GeForce RTX™ serii 40 z łatwością poradzi sobie nawet z najbardziej wymagającymi grami. MUX Switch z obsługą technologii NVIDIA Advanced Optimus zapewni Ci pełną moc procesora graficznego. \n', , 'Intel Core i9', '32 ', '1 TB SSD', 'Intel Iris Xe Graphics', 'Brak', 2, 2117, 397);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(5, 'GIGA PRO FULL ULTRA DELUXE', 'Wejdź do gry i poczuj, czym jest prawdziwa moc dzięki laptopowi GIGA PRO FULL ULTRA DELUXE. W jego stylowej obudowie znajdziesz wyłącznie najnowocześniejsze podzespoły. Bezkompromisowy procesor Intel Core 13. generacji w połączeniu z NVIDIA GeForce RTX 40 są gotowe do działania. Sprawdź, jak świetnie radzą sobie w Twoich ulubionych grach. \n', , 'Intel Core i9', '64 ', '512 GB HDD', 'Intel Iris Xe Graphics', 'Windows 11 Professional\n', 2, 9879, 44);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(6, 'LINUXBOOK UBNT 11', 'LINUXBOOK UBNT 11 to wyjątkowy laptop, który łączy w sobie trzy niezwykle ważne cechy: szybkość, łatwość obsługi\noraz bezpieczeństwo.\nW porównaniu z tradycyjnymi laptopami, które często wymagają długiego czasu uruchomienia i zapewnienia odpowiedniej wydajności, ten model zapewnia natychmiastową reakcję i płynną pracę.\n', , 'Intel Core i7', '8 ', '100 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Home', 2, 9935, 394);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(7, 'Silver Monkey X Battlestation', 'Jeżeli szukasz komputera, dzięki któremu rozpoczniesz swoją przygodę w grach, to Silver Monkey X Battlestation jest stworzony dla Ciebie. Ten zestaw zaoferuje Ci wszystko, czego potrzebujesz, aby zdobyć doświadczenie i podjąć próbę podboju rankingów w popularnych grach. Zapomnij o długich czasach ładowania i kłopotach z płynnością podczas grania.\n', , 'AMD Ryzen 7', '16 ', '2 TB SSD', 'Intel UHD Graphics', 'Windows 10 Home', 1, 5516, 67);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(8, 'SKYLEND S232', 'Poznaj wydajność, która nie boi się wyzwań. SKYLEND S232 to laptop, który poradzi sobie z każdymi wyzwaniami, jakie będą na niego czekać w rozgrywkach online. Do tego pracuje cicho i wydajnie, aby zagwarantować Ci moc w nawet najbardziej wymagających grach. Duży ekran z szybkim odświeżaniem ułatwi Ci namierzenie wroga i zagwarantuje nad nim przewagę. \n\n', , 'Intel Core i5', '16 ', '1 TB SSD', 'AMD Radeon Graphics', 'Brak', 2, 7074, 344);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(9, 'CHILL NIGHT 6sTar', 'Poznaj laptop CHILL NIGHT 6sTar, który łączy w sobie zaawansowaną technologię i wygodę użytkowania. Ten niezwykle funkcjonalny komputer przenośny oferuje Ci bezkompromisową wydajność dzięki nowatorskiej architekturze. Ciesz się długim czasem pracy na baterii, wydajnym przetwarzaniem wielowątkowym oraz grafiką, idealną do intensywnych zadań.\n', , 'AMD Ryzen 7', '16 ', '240 GB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 11 Home', 2, 7367, 9);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(10, 'WTRBMB FLEX x6A', 'Nasi inżynierowie dbają o to, by każdy WTRBMB posiadał przetestowane i wydajne komponenty. Dzięki temu masz pewność, że otrzymujesz sprzęt sprawdzony w boju i złożony z najwyższej jakości komponentów. Do Ciebie przyjeżdża komputer gotowy do gry na najwyższych detalach. WTRBMB FLEX i Elite to komputery poprawnie skonfigurowane, starannie złożone, oferujące dobrą wydajność.\n', , 'Intel Core i5', '64 ', '512 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 1, 5143, 55);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(11, 'Black Pearl A3', 'Gotowy zestaw komputerowy to idealne rozwiązanie dla tych, którzy nie posiadając odpowiedniej wiedzy, nie chcą ryzykować doborem podzespołów, czy późniejszym złożeniem ich w poprawnie funkcjonującą jednostkę. Niestety tzw. gotowce często są również pułapką zastawioną na tych najmniej doświadczonych użytkowników, którzy nęceni wybitnie atrakcyjną ceną zupełnie nie dostrzegają, że część komponentów jest bardzo słabej jakości.\n', , 'Intel Core i9', '8 ', '2 TB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 11 Home', 1, 8919, 11),
(12, 'Virtual 15XX', 'Virtual 15XX to bardzo uniwersalne urządzenie. Szukasz sprzętu, który posłuży Ci do pracy biurowej, nauki, czy jako domowe centrum rozrywki? Ten komputer sprawdzi się w każdym z tych zadań. Jego zaawansowane komponenty zapewnią Ci komfortową obsługę każdego dnia. Praca z arkuszami kalkulacyjnymi od teraz będzie bardziej wygodna dzięki dostępnej klawiaturze numerycznej. \n', , 'Intel Core i5', '16 ', '1 TB SSD', 'AMD Radeon Graphics', 'Windows 11 Professional\n', 1, 1333, 8);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(13, 'Extensa BETA 3', 'Ten komputer gamingowy to potężna maszyna, stworzona do zapewnienia niezwykle płynnego i immersyjnego doświadczenia podczas grania. Wyposażony w najnowocześniejsze podzespoły, takie jak wysokowydajny procesor, mocną kartę graficzną i dużą ilość pamięci RAM, gwarantuje doskonałą jakość obrazu i wydajność.\n\n\n', , 'Intel Core i7', '32 ', '512 GB HDD', 'Intel Iris Xe Graphics', 'Brak', 1, 4435, 34);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(14, 'BMW M5 POOR', 'BMW M5 to potężny komputer gamingowy, który zapewnia niesamowite doznania podczas grania. Wyposażony w najnowocześniejsze podzespoły, takie jak mocny procesor, wysokiej klasy karta graficzna i duża ilość pamięci RAM, ten komputer jest gotowy do obsługi najnowszych i najbardziej wymagających gier. Dodatkowo, elegancki design i solidna konstrukcja sprawiają, że BMW M5 to nie tylko potężne narzędzie do gier, ale także stylowe uzupełnienie każdego biurka.\n', , 'Intel Core i9', '64 ', '512 GB SSD', 'Intel UHD Graphics', 'Windows 10 Home', 1, 8019, 20);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(15, 'BIAŁA MEWA ', 'Biała Mewa mosiężny komputer gamingowy, który dostarcza niesamowitego wrażenia podczas rozgrywki. Wyposażony w najnowsze podzespoły i wydajny procesor, Biała Mewa zapewnia płynną i niezakłóconą grę nawet w najbardziej wymagających tytułach. Ponadto, jego designerska biała obudowa z subtelnymi elementami morskiej tematyki sprawia, że jest to nie tylko potężna maszyna, ale również estetyczne dzieło sztuki. Zapewnij sobie najlepsze doświadczenie w grach dzięki Białej Mewie, dostępnej w Techkomie!\n', , 'Intel Core i3', '8 ', '1 TB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 1, 3442, 490);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(16, 'CAPRIO JAPKO x360 830 G9', 'Zapewnij wszechstronność swojemu ulubionemu miejscu pracy, dzięki komputerowi CAPRIO JAPKO x360 830 G9. Ten laptop klasy korporacyjnej oferuje nowe funkcje telekonferencji CAPRIO Presence oraz wydajność i bezpieczeństwo, którymi można łatwo zarządzać w hybrydowych środowiskach pracy.\n', , 'Intel Core i5', '16 ', '240 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Home', 2, 2837, 369);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(17, 'IMBECYL 17\' Y2', 'Techkom prezentuje nowoczesny laptop gamingowy, idealny dla pasjonatów gier. Wyposażony w najnowszy procesor i wydajną kartę graficzną, zapewnia płynne i realistyczne doznania podczas rozgrywki. Precyzyjna klawiatura, odświeżający ekran o wysokiej rozdzielczości oraz system chłodzenia to tylko niektóre z cech tego potężnego urządzenia. Gotowy na wyzwania wirtualnego świata, ten laptop z pewnością spełni oczekiwania najbardziej wymagających graczy.\n', , 'Intel Core i9', '64 ', '512 GB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 10 Home', 2, 4281, 381);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(18, 'ZONEO 984/19 ST', 'ZONEO 984/19 ST to perfekcyjny laptop gamingowy dostępny w Techkom. Wyposażony w potężny procesor i kartę graficzną, zapewnia niezrównaną wydajność i płynne działanie nawet najnowszych gier. Dodatkowo, laptop posiada dużą i szybką pamięć RAM oraz pojemny dysk SSD, który zapewnia błyskawiczne ładowanie danych. Ekran o wysokiej rozdzielczości z technologią IPS gwarantuje niesamowity obraz o żywych kolorach.\n', , 'Intel Core i7', '8 ', '1 TB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 2, 5171, 51);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(19, 'SPECTRE GACUS', 'SPECTRE GACUS to wszechstronny laptop gamingowy, dostępny w ofercie Techkom. Wyposażony w potężny procesor, zapewnia niesamowitą wydajność podczas grania w najnowsze tytuły. Jego zaawansowany system chłodzenia sprawia, że możesz cieszyć się nieprzerwaną rozgrywką przez długie godziny. Atrakcyjny wygląd, pełnoekranowy ekran o wysokiej rozdzielczości oraz mocne karty graficzne to tylko niektóre z jego zalet.\n', , 'Intel Core i3', '32 ', '512 GB SSD', 'Intel UHD Graphics', 'Brak', 2, 9879, 388);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(20, 'HELI X KOPTER', 'Techkom przedstawia nowy komputer gamingowy HELI X KOPTER - idealny wybór dla pasjonatów gier! Wyposażony w potężny procesor, najnowszą kartę graficzną i szybki dysk SSD, ten komputer zapewnia płynne i niezakłócone doświadczenie rozgrywki. Jego imponująca pamięć RAM i pojemność dysku twardego gwarantują przechowywanie wszystkich Twoich ulubionych gier. Ponadto, solidna obudowa i wyjątkowy design nadają temu komputerowi gamingowemu efektowny wygląd.\n', , 'Intel Core i7', '16 ', '2 TB HDD', ' NVIDIA GeForce RTX 4060', 'Brak', 1, 5657, 392);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(21, 'Router TP-Link MR200', 'Wykorzystaj pełne możliwości sieci 4G LTE dzięki routerowi Archer MR200, który potrafi osiągnąć prędkości pobierania aż do 150Mb/s. Archer MR200 pozwala udostępnić sieć 4G LTE wielu urządzeniom jednocześnie abyś mógł cieszyć się filmami, szybkim pobieraniem plików oraz czatem wideo bez przeszkód.', , NULL, NULL, NULL, NULL, NULL, 3, 204, 66),
(22, 'TP-Link Archer C6', 'Archer C6 rozgłasza dwie oddzielne sieci bezprzewodowe w pasmach 2,4GHz i 5GHz, zapewniając bardzo wysoką wydajność połączeń bezprzewodowych. Daje to możliwość jednoczesnego korzystania z dwóch dedykowanych sieci bezprzewodowych, o prędkościach odpowiednich dla nawet najbardziej wymagających zastosowań.', , NULL, NULL, NULL, NULL, NULL, 3, 190, 112);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(23, 'ASUS RT-AX53U', 'ASUS RT-AX53U to dwuzakresowy router Wi-Fi AX1800 pracujący w standardzie Wi-Fi 6 (802.11ax). Urządzenie obsługuje technologie MU-MIMO i OFDMA, z pakietem zabezpieczeń sieciowych AiProtection napędzanym przez Trend Micro™. RT-AX53U obsługuje pasmo 80 MHz oraz modulację 1024-QAM, dzięki czemu oferuje o wiele wyższe prędkości połączeń bezprzewodowych. Zapewnia również łączną szybkością transferów sieciowych na poziomie około 1800 Mb/s – 574 Mb/s na paśmie 2,4 GHz oraz 1201 Mb/s na paśmie 5 GHz.', , NULL, NULL, NULL, NULL, NULL, 3, 321, 34),
(24, 'ASUS RT-AX58U', 'Sięgnij po standard Wi-Fi nowej generacji zapewniający przepustowość nawet 3000 Mb/s. ASUS RT-AX58U to dwuzakresowy router Wi-Fi 2x2 obsługujący najnowszy standard 802.11ax, zapewniając tym samym większą przepustowość i stabilność połączenia, przy podłączeniu wielu urządzeń sieciowych jednocześnie. Przy tym znacząco poprawia bezpieczeństwo Twoje i Twoich bliskich podczas korzystania z Internetu, wykorzystując w tym celu najnowsze rozwiązania na rynku.', , NULL, NULL, NULL, NULL, NULL, 3, 428, 88);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(25, 'Cudy X6', 'Router Cudy X6 to dwuzakresowe urządzenie, które działa w technologii Wi-Fi 6. Dzięki temu zapewnia duże prędkości zarówno w paśmie 5 GHz, jak i 2,4 GHz. Producent wyposażył go w dwurdzeniowy procesor oraz wydajne anteny, dzięki czemu router działa sprawnie i zapewnia stabilny sygnał. Dynamiczny DNS ułatwia zdalne zarządzanie routerem. Ponadto urządzenie obsługuje liczne zabezpieczenia jak np. WPA3.', , NULL, NULL, NULL, NULL, NULL, 3, 219, 9),
(26, 'ASUS RT-AX57', 'Z łatwością wdróż sieć Wi-Fi 6 w swoim domu i ciesz się stabilnymi oraz niezawodnymi połączeniami z routerem ASUS RT-AX57. Wysoka przepustowość oraz liczne technologie wspierają obsługę wielu urządzeń jednocześnie na dużym obszarze. Rozszerz zasięg i rozbuduj sieć dzięki wsparciu dla rozwiązania ASUS AiMesh. Dbaj o bezpieczeństwo z AiProtection oraz łatwo monitoruj i zarządzaj siecią z poziomu aplikacji mobilnej.', , NULL, NULL, NULL, NULL, NULL, 3, 422, 43);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(27, 'TP-Link Archer AX72 Pro', 'Z łatwością obsługuj dziesiątki urządzeń do przesyłania strumieniowego i grania w tym samym czasie z routerem TP-Link Archer AX72 Pro. Ten wielogigabitowy router WiFi 6 AX5400 z portem 2.5G zapewnia prędkości dochodzące do 5400 Mb/s w dwóch pasmach, zapewniając płynną transmisję i szybsze prędkości pobierania.', , NULL, NULL, NULL, NULL, NULL, 3, 234, 45);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(28, 'Logitech G502 HERO', 'Myszka gamingowa Logitech G502 HERO to potężna mysz do gier, która oferuje cały zestaw funkcji dla graczy. Zaawansowany czujnik optyczny zapewniający maksymalną precyzję śledzenia ruchów, podświetlenie RGB z możliwością dostosowania, niestandardowe profile gier i ciężarki z możliwością zmiany pozycji. To wszystko sprawia, że Mysz do gier G502 HERO jest odpowiednim narzędziem, aby podjąć wyzwanie.\r\n\r\nSprawdź, jak produkt wygląda w rzeczywistości. Chwyć zdjęcie poniżej i przeciągnij je w lewo lub prawo aby obrócić produkt lub skorzystaj z przycisków nawigacyjnych.\r\n\r\n', , NULL, NULL, NULL, NULL, NULL, 4, 62, 92),
(29, 'Genesis Xenon 220 G2', 'Często grasz przy komputerze do późnych godzin nocnych a klikanie myszki irytuje pozostałych domowników? Dzięki myszce Genesis Xenon 220 możesz to zmienić. Urządzenie wyposażono w ciche przełączniki przycisków redukujące pozom hałasu do minimum, zapewniając spokojny sen pozostałej części lokatorów. Do tego ergonomiczny kształt myszki zapewni komfort podczas długich godzin użytkowania.', , NULL, NULL, NULL, NULL, NULL, 4, 89, 40);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(30, 'SteelSeries Rival 5', 'Poznaj SteelSeries Rival 5 – ergonomiczną mysz z 9 programowalnymi przyciskami. Stworzona z myślą o maksymalnej szybkości zapewni Ci przewagę w grach typu: Battle Royale, FPS, MOBA, MMO. Dzięki bogatemu wyposażeniu przeniesiesz swój gaming na wyższy poziom. Graj precyzyjnie i intensywnie z nowoczesnym sensorem TrueMove Air i przełącznikami Golden Micro IP54. Poczuj prawdziwą lekkość, brak oporu i opanuj rozgrywkę bez najmniejszych problemów.', , NULL, NULL, NULL, NULL, NULL, 4, 53, 100);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(31, 'Beyerdynamic DT770 Pro', 'Praca z dźwiękiem wypełnia Twój czas? Jeśli tak to seria profesjonalnych słuchawek DT880 PRO jest właśnie dla Ciebie. Bez względu na to, czy robisz to profesjonalnie w studio nagraniowym, czy w zaciszu pokoju Tworzysz własne covery lub filmiki, model ten świetnie sprawdzi się w masteringu, czy monitorowaniu dźwięku.', , NULL, NULL, NULL, NULL, NULL, 4, 635, 245);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(32, 'Logitech G PRO X Lightspeed', 'Logitech G PRO X Lightspeed to bezprzewodowy zestaw słuchawkowy dla graczy, dzięki któremu będziesz słuchał jak profesjonalista i brzmiał jak profesjonalista. Zestaw ten pozwoli Ci cieszyć się dźwiękiem i głosem najwyższej jakości, korzystając z wygody stabilnego połączenia bezprzewodowego 2,4 GHz. Czystość rozmów zapewni technologia mikrofonu Blue VO!CE*. Dzięki niej poczujesz się bardziej pewnie, komunikując się z innymi graczami.', , NULL, NULL, NULL, NULL, NULL, 4, 534, 46);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(33, 'HyperX Cloud Alpha', 'HyperX™ Cloud Alpha to słuchawki o przełomowej dwukomorowej konstrukcji, zapewniającej większą wyrazistość dźwięku i mniej zniekształceń. Podwójne komory pozwalają oddzielić basy od tonów średnich i wysokich, umożliwiając optymalne dostrojenie i czystsze, bardziej zrównoważone brzmienie. Słuchawki Cloud Alpha doskonale wpisują się w tradycję wydajności i komfortu produktów z rodziny HyperX. Zastosowano w nich charakterystyczną czerwoną piankę z pamięcią kształtu, regulowany pałąk oraz obicie z miękkiej i jeszcze bardziej elastycznej imitacji skóry.', , NULL, NULL, NULL, NULL, NULL, 4, 753, 33);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(34, 'Sharkoon Skiller SGH2', 'Słuchawki Sharkoon Skiller SGH2 wyposażone zostały w wysokiej jakości ruchomy mikrofon wielokierunkowy, który sprawdzi się nie tylko podczas samotnej sesji przy komputerze, ale również podczas spotkania, na którym obecnych jest wiele osób. Pozycję mikrofonu możesz łatwo regulować i dostosować do własnych potrzeb.', , NULL, NULL, NULL, NULL, NULL, 4, 557, 92);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(35, 'Silver Monkey X Mandrill', 'Graj i korzystaj z wielu funkcji, jakie oferuje klawiatura Silver Monkey X Mandrill. Wykonana z tworzywa ABS zapewni Ci trwałość i odporność na uszkodzenia. Bawełniana otoczka kabla sprawi, że się nie zapląta i nie przeszkodzi Ci w swobodnym korzystaniu z klawiatury. Mandrill możesz ustawić w wygodnej i stabilnej pozycji dzięki gumowanym nóżkom. Ma też podpórkę pod nadgarstki, możliwość blokady klawisza „Windows” oraz pokrętło do sterowania multimediami. Switche rubber dome sprawią, że każde Twoje naciśnięcie będzie wygodne i precyzyjne.', , NULL, NULL, NULL, NULL, NULL, 4, 832, 48);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(36, 'Keychron K2 C3H', 'Keychron K2 C3H to wyjątkowa klawiatura pod względem prostoty, jak i wygody użytkowania. Zapewnij sobie odpowiedni komfort pracy w biurze lub w domowym zaciszu. Graj w ulubione gry i ciesz się doskonałą pracą przełączników mechanicznych z możliwością ich szybkiej wymiany. Elegancka, kompaktowa i wytrzymała konstrukcja z aluminiową ramą świetnie wpasuje się w przestrzeń na Twoim biurku. Co więcej, bezprzewodowe działanie da Ci pełną swobodę pracy.', , NULL, NULL, NULL, NULL, NULL, 4, 538, 61);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(37, 'Roccat Magma AIMO', 'ROCCAT Magma to ergonomiczna klawiatura gamingowa, którą charakteryzuje wysoka jakość wykonania, niezawodność i szybki czas reakcji. To cechy, dzięki którym odniesiesz sukces. Jej funkcjonalność oraz konstrukcja dostosowana jest typowo do gamingu. Klawiatura ROCCAT Magma pomoże Ci odmienić losy rozgrywki na Twoją korzyść.', , NULL, NULL, NULL, NULL, NULL, 4, 967, 24);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(38, 'Sony PlayStation 5', 'Konsola Sony PlayStation 5 Slim stwarza niewyobrażalne do tej pory możliwości rozgrywki. Ultraszybki dysk SSD zapewnia błyskawiczne czasy wczytywania. Wykorzystując moc procesora niestandardowego, procesora graficznego i dysku SSD ze zintegrowanym We/Wy, stworzono nowe zasady tego, na co stać konsolę PlayStation.\r\n\r\nEfekty dotykowe, adaptacyjne efekty „Trigger” i technologia dźwięku 3D* wciągną Cię w realistycznie odwzorowany świat niesamowitych gier nowej generacji na PlayStation. PS5 Slim zapewnia graczom potężną technologię gier w eleganckiej, niewielkiej konsoli.', , NULL, NULL, NULL, NULL, NULL, 5, 3446, 357),
(39, 'Microsoft Xbox Series X', 'Przyszłość gier właśnie nadeszła. Na imię jej Xbox Series X. W tej konsoli, w ramach architektury XboX Velocity, dokonała się głęboka integracja zaplecza sprzętowego z oprogramowaniem.\r\n\r\nOwocem tej fuzji jest niespotykana dotąd dynamika gier oraz realizm inspirujący do nieustannego eksplorowania wirtualnych światów. Xbox Series X spełnia marzenie o ray tracingu na konsoli, ogromnej wydajności, większej przestrzeni na gry.', , NULL, NULL, NULL, NULL, NULL, 5, 3565, 218);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(40, 'Microsoft Xbox Series S', 'Oto Microsoft Xbox Series S - konsola nowej generacji, która, pomimo że jest o 60% mniejsza od swojego większego brata Xbox Series X, posiada komponenty, które gwarantują gaming na najwyższym poziomie. Brak napędu sprawia, że konsola jest w pełni cyfrowa, a dysk SSD NVMe o pojemności 512 GB i architekturze Xbox Velocity nie tylko pomieści Twoje ulubione gry, ale również błyskawicznie je wczyta.\r\n\r\nZastosowany w konsoli Xbox Series S mocny układ graficzny pozwoli na grę w jakości 1440p przy nawet 120 klatkach na sekundę. Ponadto, urządzenie obsługuje technologię ray tracingu sprawiając w ten sposób, że gry będą wyróżniać się niesamowitym realizmem. Konsola odtwarza także materiały multimedialne w rozdzielczości 4K.', , NULL, NULL, NULL, NULL, NULL, 5, 8445, 36),
(41, 'Sony PlayStation 4 Slim', 'Poznaj mniejszą i smuklejszą konsolę PlayStation 4 Slim. Poza nowym wyglądem urządzenie oferuje graczom niesamowite wrażenia wizualne dzięki obecności grafiki HDR. Pomniejszona wersja PS4 zadziwia nie tylko designem, ale i cichszą pracą połączoną z niższym poborem mocy. Na tym polu deklasuje poprzednie wersje konsoli. Wszystkie gry, aplikacje, zrzuty ekranu i filmy zapiszesz teraz na dysku o pojemności 500 GB.\r\n\r\nSprawdź, jak PlayStation 4 wygląda w rzeczywistości. Chwyć zdjęcie poniżej i przeciągnij je w lewo lub prawo, aby obrócić produkt, lub skorzystaj z przycisków nawigacyjnych.', , NULL, NULL, NULL, NULL, NULL, 5, 4783, 476);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(42, 'Samsung Galaxy S23', 'Chwytaj dzień i noc. Z zaawansowanym zestawem aparatów w Galaxy S23 w dzień i w nocy zrobisz zdjęcia rewelacyjnej jakości. Wyposażony w matrycę o wysokiej rozdzielczości 50 MP, doskonale utrwalające światło piksele, wyłapujące więcej światła oraz optyczną stabilizację obrazu (OIS) pozwoli Ci zawsze rejestrować wyraźne kadry.', , NULL, NULL, NULL, NULL, NULL, 6, 6672, 353);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(43, 'Smartfon SAMSUNG Galaxy S24 Ul', 'Wkrocz w erę Galaxy AI. Uwolnij zupełnie nowe poziomy kreatywności, produktywności i możliwości dzięki Galaxy S24 Ultra. Sprawdź, jak dopracowana w najmniejszym szczególe sztuczna inteligencja zadba o to, by każdy dzień był jeszcze wygodniejszy.', , NULL, NULL, NULL, NULL, NULL, 6, 4346, 352);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(44, 'Smartfon GOOGLE Pixel 6a', 'Pixel 6a 6/128GB 5G jest niezwykłym smartfonem od Google, który oferuje użytkownikom niezwykłe technologie w kompaktowej i eleganckiej formie. Oferując szybki procesor, dużą ilość miejsca na dane i duże możliwości fotograficzne, ten telefon jest idealnym towarzyszem dla każdego, kto szuka wyjątkowych doświadczeń z technologii.', , NULL, NULL, NULL, NULL, NULL, 6, 2335, 21);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(45, 'Smartfon APPLE iPhone 13', 'Innowacyjny system dwóch aparatów został zaaranżowany na nowo, przesuwając obiektywy o 45 stopni. Dzięki temu nowy szerokokątny obiektyw może robić jeszcze wspaniałe zdjęcia i filmy w warunkach słabego oświetlenia. Ultraszerokokątny obiektyw obejmuje szerszą ramkę, dzięki czemu uchwycisz jeszcze więcej.', , NULL, NULL, NULL, NULL, NULL, 6, 3516, 99);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(46, 'Smartfon XIAOMI Redmi Note 12 ', 'Zaawansowany procesor MediaTek Dimensity 1080, jaki zastosowano w smartfonie XIAOMI, nieustannie dba o wysoką wydajność obsługi Twoich aplikacji. Do tego smartfon ma 6 GB pamięci RAM. Wyjątkową funkcjonalność pracy sprzętu wspiera dodatkowo gotowość procesora do obsługi sieci 5G.', , NULL, NULL, NULL, NULL, NULL, 6, 3678, 42);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(47, 'Smartfon MOTOROLA Moto G32', 'Smartfon MOTOROLA MOTO G32 łączy w sobie wszystkie cechy idealnego urządzenia mobilnego: dużą pamięć, doskonałą jakość dźwięku, a także dopracowany wyświetlacz i solidny procesor z funkcją usprawniającą zarządzanie nadmiarem ciepła. Jest on też zabezpieczony czytnikiem linii papilarnych, a codzienne funkcjonowanie ułatwi dual SIM z jednoczesnym użyciem karty pamięci, NFC do płatności zbliżeniowych i dokładna nawigacja satelitarna z obsługą AGPS. Nadszedł czas, by sprawdzić możliwości, jakie oferuje ten niezwykły sprzęt mobilny.', , NULL, NULL, NULL, NULL, NULL, 6, 8523, 105);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(48, 'Smartfon REALME 11 Pro+', 'Smartfon realme 11 Pro+ 5G zachwyca swoją wydajnością, zakrzywionym ekranem AMOLED 120 Hz o przekątnej 6,7\" oraz aparatem głównym z matrycą OIS SuperZoom 200 MP. Korzystanie z czterokrotnego, bezstratnego zoomu, trybu Fotografii Ulicznej 4.0 oraz trybu Grupowego pozwoli każdemu początkującemu amatorowi fotografii cieszyć się z uchwyconych momentów. A kiedy chcesz zrobić selfie z przyjaciółmi, skorzystaj z przedniego obiektywu - 32 MP.', , NULL, NULL, NULL, NULL, NULL, 6, 4299, 403);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(49, 'Smartfon MYPHONE Hammer Blade ', 'BLADE 4 to wytrzymały smartfon pełen funkcji nie tylko dla aktywnych w terenie. Jego odporność potwierdzają certyfikaty IP69 i wojskowy MIL-STD-810G, a pojemna bateria 6150 mAh zapewnia mu długie działanie. Są też takie ciekawostki jak system chłodzenia, programowalny przycisk czy termometr na podczerwień. Warto też wspomnieć o aparacie wysokiej rozdzielczości, którym można robić zdjęcia pod wodą.', , NULL, NULL, NULL, NULL, NULL, 6, 8435, 107);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(52, 'Usunięcie prawego CTRL\'a', 'Proces usunięcia klawisza CTRL po prawej stronie klawiatury bo i tak bądźmy szczerzy kto tego używa. ', , NULL, NULL, NULL, NULL, NULL, 7, 2, 9999);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(53, 'Zdjęcie folii z radiatora', 'Każdemu może się zdarzyć :) A my naprawimy to za ciebie', , NULL, NULL, NULL, NULL, NULL, 7, 500, 456);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(54, 'Umycie komputera', 'Zakurzony komputer to prawdziwy wstyd przy znajomych. Najlepiej jak wpadnie do nas na szybką kąpiel pod myjką ciśnieniową. Oszczędzisz wtedy czas i energię bo pieniądze nie koniecznie.', , NULL, NULL, NULL, NULL, NULL, 7, 214, 547);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(55, 'Pełna obsługa asystenta', 'Każdy z nas ma przynajmniej jednego członka rodziny który kompletnie nie ogarnia komputerów. Nasz asystent dopomoże w takiej sytuacji a ty będziesz mógł spokojnie grać gdy nasz pracownik zakłada mamie konto w aplikacji ROSSMANN', , NULL, NULL, NULL, NULL, NULL, 7, 8999, 5684);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(56, 'Wymiana bulbulatora', 'Najczęstszy problem urządzeń elektronicznych to uszkodzony bulbulator. Nasz serwis oferuje darmową wymianę tego elementu (o ile nie jest on uszkodzony).', , NULL, NULL, NULL, NULL, NULL, 7, 1, 798);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
