INSERT INTO `rewiews` (`id`, `username`, `date`, `review`, `rating`) VALUES
(1, 'Paweł Kupiec', '2022-01-19', 'Rakieta, nie komputer! To mój drugi PC \"gotowiec\" od Techkom i kolejny raz się nie zawiodłem. Kupując ten zestaw otrzymujesz gotowy kombajn,\r\nna którym tylko instalujesz grę i nie martwisz się o nic - wszystko śmiga w takiej ilości FPS, że szok. Do tego całość jest bardzo schludnie\r\nzmontowana, no i oczywiście obsługa klienta w x-kom - jak zawsze na najwyższym poziomie. Inne sklepy mogą Wam buty lizać.', 5),
(2, 'reoberto1124', '2023-05-26', 'Petarda!!! Kupiłem po Black Friday za 12100 PLN.\r\nZostałem bardzo pozytywnie zaskoczony specyfiką. Szczególnie tą owianą tajemnicą. Karta MSI, szybszy RAM (3600) oraz zasilacz firmy Be Quiet :)\r\nKalkulowałem przed zakupem ile kosztowałoby mnie złożenie takiego PC. Po sprawdzeniu cen w większości wiodących sklepów okazało się że same podzespoły wychodziły drożej. I to bez systemu operacyjnego!! Posiadam i gram od 2 tygodni w każdą gierkę na ustawieniach Ultra :) Polecam z czystym sumieniem wziąć na raty 0%.', 5),
(3, 'Enderdragon', '2023-11-02', 'Świetny serwis. Wcześniej sam składałem sobie komputery, bo przykładam dużą wagę do optymalnego dobrania podzespołów, aż wreszcie\r\nznalazłem ten sklep. Nie ma co poprawiać. Świetnie dobrane elementy i profesjonalne ustawienia Biosu. Praca wentylatorów dobrana tak, że\r\npodczas pracy pod Windowsem jest bardzo cicho, dopiero w grach jest głośniej, ale wtedy i tak zakładam słuchawki. Karta graficzna w grach\r\nbardzo wydajna, gram w rozdzielczości 3440x1440 bo taki mam monitor. Polecam.', 5),
(4, 'Julka', '2024-01-18', 'Jako prezent urodzinowy dla 16 latka sprawdził się znakomicie. Szybka realizacja. Wysoka jakość i kultura pracy.', 5),
(5, 'Ninebot', '2024-01-04', 'polecam', 5),
(6, 'jurek', '2023-04-04', 'niestety ten komputer pro to nie jest parametry dell inspiron 510 .\n\nszybka wysyłka, zwrot pieniędzy w terminie .\n\nkomputer który zakupiłem jest podrobiony, po wpisaniu modelu z informacji w komputerze, nr bios wyskakuje model linux.', 2),
(7, 'zapała', '2022-10-11', '\"Super sprzęt i bardzo dobry kontakt ze sprzedającym. Polecam\"\r\n\r\nGamingowy Hyperbook LENOVO T480 i7-8th MX150 16GB 512 GB Poleasingowy kl. A', 5),
(8, 'julek231', '2021-02-28', '\"Proszę Państwa, wspaniali ludzie pracują tutaj, dopasowali laptopa do moich potrzeb. Dałbym sześć gwiazdek jakbym mógł. Polecam serdecznie. :)\"', 5),
(9, 'polariswodagazowana', '2024-03-21', '\"Polecam. Bardzo dobry kontakt ze sprzedawcą. Towar zgodny z opisem. Minus jedna gwiazdka w obsłudze kupującego za zabezpieczenie przesyłki. W moim przypadku karton był o półtora razy szerszy od laptopa, przez co ten swobodnie przesuwał się wewnątrz przesyłki. Foli bąbelkowej też można by użyć więcej. Niemniej, laptop dotarł do mnie bez uszkodzeń.\"', 5),
(10, 'popek', '2024-01-29', '\"super sprzedawca!!!!super koks \"', 5),
(12, 'Ivo Lucio Lusaias', '2024-02-01', 'Sklep ten nie honoruje gwarancji. Polskie prawo stanowi, że w przypadku braku jasnego okresu gwarancji gwarancja powinna wynosić 2 lata. Ich obsługa klienta również jest bałaganem, wiele osób odpowiedziało na moje roszczenie gwarancyjne, każda z nich inną odpowiedzią, dopóki nie zdecydowały się odrzucić bezpodstawnie.', 1),
(13, 'Szampon męski 6w1', '2024-01-16', 'Bardzo mili i pomocni ludzie.\r\n\r\nNa początku nie mogłem znaleźć sklepu. Oto kierunek:\r\n\r\nJest na pierwszym piętrze. Więc skorzystaj z windy/schodów. Sklep sąsiaduje ze sklepem CCC.', 5),
(14, 'Sławek C', '2023-07-12', 'Bardzo źle zorganizowane.\r\nZamówiłem coś przez Internet....Poprosiłem o odbiór w sklepie.\r\nCzekałem 30 minut, żeby to dostać....\r\nMożna sobie wyobrazić, że jeśli zamówiłeś coś przez Internet i otrzymałeś powiadomienie, że przedmiot jest gotowy, dostawa nie powinna zająć tak dużo czasu...', 2.5),
(15, 'jakiś rusek', '2023-09-01', 'Jeśli chcesz pozostać w kolejce przez cały dzień, zapraszamy do sklepu.', 1),
(16, 'Monikanta Św.', '2024-02-04', 'Zamówiłem przez internet i pojechałem odebrać osobiście. Sklep jest w dobrej lokalizacji, a personel recepcji jest wykwalifikowany i pomocny, chętnie odpowie na Twoje pytania.', 4.5),
(17, 'Sam Maximov', '2023-12-28', 'Zawsze miałem świetne doświadczenia z TechKom, ale dziś miałem okazję porozmawiać z kimś, kto nawet nie próbował mi sprzedać notatnika. Na pewno nie wrócę do tego sklepu.', 1),
(18, 'Andrzej', '2024-02-06', 'Kupiłem tutaj laptopa Dzisiw. Ponieważ zamówiłem w przedsprzedaży, nie spędziłem zbyt wiele czasu, a reakcja była szybka i szybka', 5),
(19, 'Mateusz Pająk', '2024-02-02', 'Szczególnie podobało mi się wyświetlanie różnych telefonów komórkowych ze wszystkimi potrzebnymi szczegółami na ich ekranach.', 5),
(20, 'Lokalny Pan Przewodnik', '2023-12-31', 'Bardzo miły personel, szybka reakcja i dobra jakość.', 5),
(21, 'Grzegorz Zdrój', '2013-05-06', 'Bardzo miła obsługa klienta.', 5),
(22, 'cichy informatyk', '2024-07-25', 'Wszystko jest w porządku, z wyjątkiem długich kolejek.', 4),
(23, 'Paweł Zontek', '2023-02-16', 'Lubię ten sklep', 4.5),
(24, 'Michał B', '2019-08-15', 'Obsługa z wydajnością 3 klientów na 30 minut przy pracy 5 stanowisk, hit... stworzenie dedykowanego miejsca do przyjmowania zamówień... banda idiotów na stanowiskach kierowniczych', 1.5),
(25, 'Bosiek PIO', '2020-06-02', 'Sprzedażowo firma w porządku, jednak jestem w trakcie reklamacji produktu i pierwsze podejście było negatywne (karta graficzna wyraźnie wymaga wymiany termopadów w pamięci) i wygląda na to, że obsługa niewiele dała wysiłek. A więc sprzedaż plus serwis, hmm.\nPróby sprzedaży dodatkowych produktów typu Cross-Selling nieco spowalniają usługę (jak ma to miejsce w przypadku większości firm tego typu).\nNiedawno sprzedawca dokonał cudu, zachęcając dwie młode dziewczyny do wykupienia dodatkowego ubezpieczenia przy zakupie iPhone\'a – myślę, że dotarcie do kasy zajęło im około piętnastu minut.', 3),
(26, 'Kasia Uran-335', '2019-11-20', 'Czas temu odebrałem tablet, a ostatni raz z chłopakiem złożyłem reklamację. Wszyscy panowie zawsze są bardzo mili i pomocni. Mój ulubiony salon ze sprzętem elektronicznym, na pewno będę wracać. :)', 5),
(27, 'Złoty', '2022-11-07', 'Duży sklep, szeroki wybór produktów\nJednak czas oczekiwania na otrzymanie zamówienia internetowego jest zdecydowanie za długi.', 3),
(28, 'MęczennikSystemu', '2018-08-01', 'Wracając do czasów, które słusznie już minęły, po co mieć numery, a obsługa i tak idzie jedna po drugiej, na odbiór zamówienia czeka się prawie godzinę, poza tym, że w tej godzinie pracownicy ciągle gdzieś znikali i mimo praktycznie 6 stanowisk jednocześnie, w rzeczywistości były to tylko 4 stanowiska jednocześnie, przez większość czasu 3. Weź numer i idź na zakupy', 1.5),
(29, 'Kaalion', '2022-01-25', 'Niedawno odwiedziłem salon, aby odebrać zamówienie i jestem bardzo zadowolony. Obsługa na wysokim poziomie, zarówno profesjonalnym, jak i kulturalnym. Obsługiwał mnie bardzo miły Pan Piotr, który wykonał świetną robotę, nie mam żadnych zastrzeżeń :)', 5),
(30, 'Karyna', '2024-02-17', 'Straszna obsługa, szczerze polecam każdy inny sklep niż ten. Obsługa zachowuje się jak po kilkudniowej imprezie, może nawet zrobić sobie przerwę na rozmowę.', 1),
(31, 'Patrycja Rogowieeec', '2016-04-14', 'Zamówienie zostało złożone pod koniec miesiąca z zapewnieniem, że zostanie dostarczone i zafakturowane do ostatniego dnia miesiąca. Niestety po wielu interwencjach dostawa została zrealizowana w następnym miesiącu, co oznacza, że ​​klient otrzymuje obietnice jedynie złożenia zamówienia, a następnie zostaje odrzucony', 1),
(32, 'BAJO JAJO', '2015-05-20', 'Muszę przyznać, że poziom szybkości obsługi klientów oraz kwestia oczekiwania na swoją kolej zawstydziła afrykańskich wykonawców dróg i nigeryjską służbę zdrowia. Uświadomiono mi, że „korki” w Afryce to nic. Pozdrowienia.', 1),
(33, ' adam2', '2024-02-21', 'zimno', 3.5);

